import React, { useState } from "react";

import Expenses from "./components/Expenses/Expenses";
import NewExpense from "./components/NewExpenses/NewExpense";

function App() {

  const [enteredExpenseData, setEnteredExpenseData] = useState('');

  const expenses = [
    {
      id: enteredExpenseData.id,
      title: enteredExpenseData.title,
      amount: enteredExpenseData.amount,
      date: enteredExpenseData.date,
    },
    {
      id: 'e2',
      title: 'New TV',
      amount: 799.49,
      date: new Date(2021, 2, 12)
    },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  const addExpenseData = enteredExpense => {
    console.log("in app comp");
    console.log(enteredExpense);
    console.log(expenses);
    setEnteredExpenseData(enteredExpense);
  }

  return (
    <div>
      <NewExpense onAddExpense={addExpenseData} />
      <Expenses expenses={expenses} />
    </div>
  );
}

export default App;
